  "id_str" : "271828829226536960",
  "text" : "そしたらいつの間にか突入してきたのがポケモンじゃなくて人になってて、ルールも変わって、店内に突入してきた人はそのお店の商品を安く買える（？）とかになって、私は店員側でその侵入者をなるべく阻止する側だったけど攻撃したらだめだったから防ぎようがなかった。 #夢",
  "id" : 271828829226536960,
