  "geo" : {
  },
  "id_str" : "271828431405203457",
  "text" : "で、全滅した後ろからたくさんのポケモン達が押し寄せてきて、いつの間にか後ろの店へそのポケモンたちが突入するのを防ぐ話になって、その能力を吸収したレーザー（？）で攻撃してポケモンの首が吹っ飛んだり割とグロ描写があったりして、でも結局レーザーで防ぎきれず店内で人vsポケモンに。 #夢",
  "id" : 271828431405203457,
  "created_at" : "Fri Nov 23 04:12:03 +0000 2012",
