  "geo" : {
  },
  "id_str" : "271827876020645888",
  "text" : "超能力者のサッカー大会みたいなのを観戦した。双子になるやつとか瞬間移動できるやつとか（どちらもゴールキーパー）、フィールドを水で満たすやつとか、水の中の毒虫（？）を降らせるやつとかいて、最終的にその能力を無効化・吸収して相手にぶつけて攻撃して片方のチームが全滅してた。 #夢",
  "id" : 271827876020645888,
