  "id_str" : "271826743294312448",
  "text" : "コトノハerさんたちと温泉旅行してた。日中はすごい重装備で森の中を私が先導で探検した（詳細は覚えてない）。夜はプールみたいな広い温泉に浸かりながら温泉卵作ってた。次の日は別の人が先導で旅館の中庭に隠された池から地下の探検してた。 #夢",
