  "text" : "この春から名古屋で勤務しています。先日、就業時間中に体調が悪くなってしまい、上司に早退を願い出ました。早退自体は認められたのですが、上司は「お前はえらそうだ」と文句を言って来ました。確かに体調管理ができなかった私も悪いですが、「偉そう」と言われるほどのことでしょうか？",
