  "text" : "旧来は、働く男性の家に専業主婦となる女性が引っ越してきた。しかしこれでは、職場という環境は変わらず人間関係もそのままな男性に対し、女性は引っ越してきた先で新しい人間関係を一から作り上げる必要があり、女性側が不利だった。これは、働く男性側が、専業主婦となる女性の家に越せば解決する。",
